import React from 'react'

const DisplayPokemon = ({ pokemon }) =>{
    return(
        <ul>
                {pokemon.map((pokemon) =>(
                    <li>
                        {pokemon.name}
                    </li>

                ))}

        </ul>
    );
};

export default DisplayPokemon
